Abbiamo raccontato un po’ del nostro disco ai ragazzi di @essemagazine. 
È un’intervista sincera, abbiamo parlato di creatività, dell’importanza di fare musica con le persone che stimi, degli ingredienti migliori e dell’amore che mettiamo nel confezionare ogni nostra merendina. Link nelle stories 
#zerosei 
@frenetikandorang3 
@asian_fake

Rolls Royce non è un inno alla droga. 
Non possiamo farci nulla se il 90% dei nostri artisti preferiti erano degli sfascioni. Sta di fatto che sono passati alla storia per la loro arte e non per la loro vita privata. Stasera c’è la finale, poco conta la classifica, abbiamo già vinto. 
@achilleidol 
